<template>
    <div class="container">
        <div v-if="this.$gate.isMahasiswa()" class="row justify-content-center">
            <div v-if="status != 'unregister' && status != 'uncompleted'" class="col-md-8 mt-5">
                <div class="card">
                    <form-wizard @on-complete="onComplete" :hide-buttons="status != 'null' ? true : false"  ref="wizard" title="PENGAJUAN SKPI" subtitle="Silakan pratinjau pengiriman data Anda"   finishButtonText="Submit" color="#3490DC">
                        <tab-content title="Profil Mahasiswa" icon="fas fa-user">
                            <div class="card-body">
                                <div class="form-group">
                                    <label for="inputNama">Nama Lengkap</label>
                                    <input v-bind:value="mahasiswa.nama"  type="text" name="nama"
                                    class="form-control" placeholder="Nama Lengkap"  id="inputNama" disabled>
                                </div>
                                <div class="form-group">
                                    <label for="inputTanggalLahir">Tempat Tanggal Lahir</label>
                                    <input v-bind:value="mahasiswa.kota_lahir + ', ' + mahasiswa.tgl_lahir"  type="text" name="tgl_lahir"
                                    class="form-control" placeholder="Tempat Tanggal Lahir"  id="inputTanggalLahir" disabled>
                                </div>
                                <div class="form-group">
                                    <label for="inputIjazah">No Ijazah</label>
                                    <input v-bind:value="mahasiswa.no_ijazah"  type="text" name="ijazah"
                                    class="form-control" placeholder="No Ijazah"  id="inputIjazah" disabled>
                                </div>
                                <div class="row">
                                    <div class="col-md-6">
                                        <div class="form-group">
                                            <label for="inputNpm">Nomor Pokok Mahasiswa</label>
                                            <input v-bind:value="mahasiswa.npm"  type="text" name="npm"
                                            class="form-control" placeholder="Nomor Pokok Mahasiswa"  id="inputNpm" disabled>
                                        </div>  
                                    </div>
                                    <div class="col-md-6">
                                        <div class="form-group">
                                            <label for="inputIpk">Indeks Prestasi Kumulatif</label>
                                            <input v-bind:value="mahasiswa.ipk"  type="text" name="ipk"
                                            class="form-control" placeholder="Indeks Prestasi Kumulatif"  id="inputIpk" disabled>
                                        </div>  
                                    </div>
                                </div>
                                <div class="form-group">
                                    <label for="inputJurusan">Jurusan & Fakultas</label>
                                    <input v-bind:value="mahasiswa.jurusan.nama_jurusan + ' - ' + mahasiswa.jurusan.fakultas"  type="text" name="jurusan"
                                    class="form-control" placeholder="Jurusan & Fakultas"  id="inputJurusan" disabled>
                                </div>
                                <div class="row">
                                    <div class="col-md-6">
                                        <div class="form-group">
                                            <label for="inputTanggalMulai">Tanggal Mulai Studi</label>
                                            <input v-bind:value="mahasiswa.tgl_mulai | dateSkpi"  type="text" name="tgl_mulai"
                                            class="form-control" placeholder="Tanggal Mulai Studi"  id="inputTanggalMulai" disabled>
                                        </div>  
                                    </div>
                                    <div class="col-md-6">
                                        <div class="form-group">
                                            <label for="inputTanggalKelulusan">Tanggal Kelulusan</label>
                                            <input v-bind:value="mahasiswa.tgl_kelulusan | dateSkpi"  type="text" name="tgl_lulus"
                                            class="form-control" placeholder="Tanggal Kelulusan"  id="inputTanggalKelulusan" disabled>
                                        </div>  
                                    </div>
                                </div>
                            </div>
                        </tab-content>
                        <tab-content title="Kompetensi Data" icon="fas fa-medal">
                            <table class="table table-condensed">
                                <tbody><tr>
                                    <th style="width: 10px">#</th>
                                    <th>Nama Kompetensi</th>
                                    <th>Bidang</th>
                                    <th style="width: 40px">Point</th>
                                </tr>
                                <tr v-for="(data, index) in kompetensi.data" :key="index">
                                    <td>{{kompetensi.meta.from+index}}</td>
                                    <td>{{data.nama_kompetensi}}</td>
                                    <td>{{data.bidang_kompetensi.nama_bidang}}</td>
                                    <td>{{data.point_kompetensi}}</td>
                                </tr>
                                </tbody>
                            </table>
                            <pagination :data="kompetensi" align="center" @pagination-change-page="getKompetensi"></pagination>
                        </tab-content>
                        <tab-content title="Kompetensi Wajib" icon="fas fa-award">
                            <table class="table table-condensed">
                                <tbody><tr>
                                    <th style="width: 10px">#</th>
                                    <th>Nama Kompetensi</th>
                                    <th style="width: 40px">Uploaded</th>
                                </tr>
                                <tr v-for="(data, index) in kompetensiWajib.data" :key="index">
                                    <td>{{kompetensiWajib.meta.from+index}}</td>
                                    <td>{{data.nama_kompetensi_wajib}}</td>
                                    <td v-if="data.bukti_wajib != null" class="text-center">
                                        <span class="badge bg-success"><i class="fas fa-check"></i></span>
                                    </td>
                                    <td v-else class="text-center">
                                        <span class="badge bg-danger"><i class="fas fa-times"></i></span>
                                    </td>
                                </tr>
                                </tbody>
                            </table>
                            <pagination :data="kompetensiWajib" align="center" @pagination-change-page="getKompetensiWajib"></pagination>
                        </tab-content>
                        <tab-content title="Submit" icon="fas fa-check">
                            <div v-if="status == 'null'">    
                                <h3  class="text-center text-grey">Submit your submission</h3>
                                <h3  class="text-center text-grey">Your submission will be sent to kaprodi</h3>
                            </div>        
                            <div v-if="status == 'progress'">
                                 <div v-if="kompetensiReject.data != '' || kompetensiWajibReject != ''">
                                    <h6 class="text-center text-grey">Ada kompetensi yang tidak sesuai sebagai berikut :</h6>
                                    <table v-if="kompetensiWajibReject.data != ''" class="table table-condensed">
                                        <tbody><tr>
                                            <th style="width: 10px">#</th>
                                            <th width="30%">Nama Kompetensi</th>
                                            <th width="60%">Alasan Ditolak</th>
                                        </tr>
                                        <tr v-for="(data, index) in kompetensiWajibReject.data" :key="index">
                                            <td>{{kompetensiWajibReject.meta.from+index}}</td>
                                            <td>{{data.nama_kompetensi_wajib}}</td>
                                            <td>{{data.pesan}}</td>
                                        </tr>   
                                        </tbody>
                                    </table>
                                    <pagination :data="kompetensiWajibReject" align="center" @pagination-change-page="getKompetensiWajibReject"></pagination>
                                    <table v-if="kompetensiReject.data != ''" class="table table-condensed">
                                        <tbody><tr>
                                            <th width="5%">#</th>
                                            <th width="25%">Nama Kompetensi</th>
                                            <th width="20%">Tanggal</th>
                                            <th width="50%">Alasan Ditolak</th>
                                        </tr>
                                        <tr v-for="(data, index) in kompetensiReject.data" :key="index">
                                            <td>{{kompetensiReject.meta.from+index}}</td>
                                            <td>{{data.nama_kompetensi}}</td>
                                            <td>{{data.tgl_mulai}}</td>
                                            <td>{{data.pesan}}</td>
                                        </tr>   
                                        </tbody>
                                    </table>
                                    <pagination :data="kompetensiReject" align="center" @pagination-change-page="getKompetensiReject"></pagination>
                                </div>
                                <div v-else>
                                    <h3 class="text-center text-grey">Your submission success</h3>
                                    <h3 class="text-center text-grey">it will be validation by kaprodi</h3>
                                </div>
                            </div>
                            <div v-if="status == 'published'">
                                <h3  class="text-center text-grey">Dokumen SKPI Anda telah diterbitkan <br>silakan periksa ke akademik</h3>
                            </div>    
