                <h3 class="text-center text-grey">Mohon cek data <router-link to="/mahasiswa-profile">Mahasiswa</router-link> dan unggah <router-link to="/kompetensi">Kompetensi</router-link></h3>
            </div>
        </div>
        <div v-else class="row">
            <not-found></not-found>
        </div>        
    </div>    
</template>
<script>
export default {
    data(){
        return{
            preview:true,
            mahasiswa:{
                jurusan:{}
            },
            kompetensi:{},
            kompetensiReject:{
                data:''
            },
            kompetensiWajibReject:{
                data:''
            },
            kompetensiWajib:{
                data:''
            },
            status:'unregister',
        }
    },
    methods:{
        getMahasiswa(){
            if(this.$gate.isMahasiswa()){
                axios.get('api/mahasiswa/profile')
                .then(response => {
                    this.mahasiswa = response.data;
                })
                .catch(() => {
                    toast.fire({
                    type: 'error',
                    title: 'Load mahasiswa profile failed'
                    });
                });
            }
        },
        getKompetensi(page = 1) {
            if(this.$gate.isMahasiswa()){
                axios.get('api/kompetensi?page=' + page)
                .then(response => {
                    this.kompetensi = response.data;
                })
                .catch(() => {
                    toast.fire({
                    type: 'error',
                    title: 'Load data kompetensi failed'
                    });
                });
            }
        },
        getKompetensiReject(page = 1) {
            if(this.$gate.isMahasiswa()){
                axios.get('api/kompetensi/reject?page=' + page)
                .then(response => {
                    this.kompetensiReject = response.data;
                })
                .catch(() => {
                    toast.fire({
                    type: 'error',
                    title: 'Load data kompetensi reject failed'
                    });
                });
            }
        },
        getKompetensiWajibReject(page = 1) {
            if(this.$gate.isMahasiswa()){
                axios.get('api/bukti-kompetensi-wajib/reject?page=' + page)
                .then(response => {
                    this.kompetensiWajibReject = response.data;
                })
                .catch(() => {
                    toast.fire({
                    type: 'error',
                    title: 'Load data kompetensi wajib reject failed'
                    });
                });
            }
        },
        getKompetensiWajib(page = 1){
            if(this.$gate.isMahasiswa()){
                axios.get('api/bukti-kompetensi-wajib?page=' + page)
                .then(response => {
                    this.kompetensiWajib = response.data;
                })
                .catch(() => {
                    toast.fire({
                        type: 'error',
                        title: 'Load data kompetensi wajib kompetensi failed'
                    });
                });
            }
        },
        getStatus(){
            if(this.$gate.isMahasiswa()){
                axios.get('api/skpi/cek')
                .then(response => {
                    this.status = response.data.status;
                    if(this.status == 'progress'){                
                        this.getKompetensiReject();
                        this.getKompetensiWajibReject();       
                    }else if(this.status != 'uncompleted' && this.status != 'unregister'){
                        this.getMahasiswa();
                        this.getKompetensi();
                        this.getKompetensiWajib();
                    }else{

                    }
                })
                .catch(() => {
                    toast.fire({
                        type: 'error',
                        title: 'Get status skpi failed'
                    });
                });
            }
        },
        onComplete(){
            this.$Progress.start();
            axios.post('api/skpi')
            .then(response => {
                cusEvent.$emit('ReloadData');
                toast.fire({
                    type: 'success',
                    title: 'Submit skpi successfully'
                });
                this.$Progress.finish();
            })
            .catch(() => {
                 toast.fire({
                    type: 'error',
                    title: 'Submit skpi failed'
                });
                this.$Progress.fail();
            });
        }
    },
    updated(){
        if(this.status != 'null'){
            this.$refs.wizard.changeTab(0,3);   
        }
    },
    created(){
        this.$root.search = '';
        this.getStatus();
        cusEvent.$on('ReloadData', this.getStatus);
    },
    beforeDestroy(){
        cusEvent.$off('ReloadData', this.getStatus);
    }
}
</script>